import {Link} from 'react-router-dom';

export const ManagerNavBar = ()=> {
    return(
        <div>
          <Link to="/home" className='btn'>Home</Link>
          <Link to="/pending" className='btn'>PendindTestDrives</Link>
          <Link to="/legacy" className='btn'>LegacyTestDrive</Link>
          <Link to="/administration" className='btn'>Administration</Link>
        </div>
    );
};
